import { Component, OnInit, ViewEncapsulation } from '@angular/core';
import { LoginEOSService } from './login-eos.service';

@Component({
	selector: 'app-login-eos',
	templateUrl: './popup.html',
	styleUrls: ['./popup.css', '../../node_modules/ngx-toasta/styles/style-material.css'],
	encapsulation: ViewEncapsulation.None
})
export class LoginEOSComponent implements OnInit {

	constructor(public loginEOSService: LoginEOSService) { }

	mobileWallets = [
		/* lynx */ "data:image/png;base64,",
		/* meetone */ "data:image/png;base64,",
		/* nova */ "data:image/png;base64,",
		/* tokenpocket */ "data:image/png;base64,",
		/* bitpie */ "data:image/png;base64,",
		/* math */ "data:image/png;base64,",
		/* starteos */ "data:image/png;base64,"
	];


	ngOnInit() {
		if (this.loginEOSService.connected) {
			if (this.loginEOSService.eosioWalletType === 'scatter') {
				this.loginEOSService.initScatter(true);
			}
			// else if (this.loginEOSService.eosioWalletType === 'eostock') {
			// 	if (!(<any>window).eosTock) {
			// 		document.addEventListener('EOSTOCK_CONNECTED', () => {
			// 			this.loginEOSService.initEostock();
			// 		});
			// 		return;
			// 	}
			// 	this.loginEOSService.initEostock();
			// }
			else if (this.loginEOSService.eosioWalletType === 'wax') {
				this.loginEOSService.initWAX();
			} else if (this.loginEOSService.eosioWalletType === 'anchorLink') {
				this.loginEOSService.initAnchorLink();
			}
			else if (this.loginEOSService.eosioWalletType === 'ledger') {
				this.loginEOSService.initLedger(true);
			} 
			else if (this.loginEOSService.eosioWalletType === 'proton') {
				this.loginEOSService.initProton(true);
			}
		}
	}
}
